        <nav className="flex justify-between items-center w-full h-[5em]  fixed mt-[-70px]  text-block   font-mono navbar  text-[#ffff] ">
            <div className="logo">
                <Link href=''>
                    <h2 className="text-2xl text-[#ffff]">ğ–’ğ–”ğ–ğ–ğ–Šğ–šğ–˜</h2>
                </Link>
            </div>

            <div className="space-x-4 mr-4 orderlist">
                {link.map((nav) => {
                    const { id, text, path } = nav;
                    return (

                        <h5 as={`/${nav.path}`} href='/[pages]'>

                            <a>{text}</a>
                        </h5>

                    )
                })}
            </div>

        </nav>
    )
}


export default Nav
